import React, { useState } from "react";
import "./App.css";

function App() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [age, setAge] = useState(0);
  const [isAttendingWithGuest, setIsAttendingWithGuest] = useState(false);
  const [guestName, setGuestName] = useState("");
  const [darkMode, setDarkMode] = useState(false);

  const handleNameChange = (event) => {
    setName(event.target.value);
  };

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handleAgeChange = (event) => {
    setAge(parseInt(event.target.value));
  };

  const handleGuestAttendanceChange = (event) => {
    setIsAttendingWithGuest(event.target.value === "yes");
  };

  const handleGuestNameChange = (event) => {
    setGuestName(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log("Form submitted!");
    console.log("Name:", name);
    console.log("Email:", email);
    console.log("Age:", age);
    console.log("Attending with Guest:", isAttendingWithGuest);
    console.log("Guest Name:", guestName);
  };

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
  };

  return (
    <div className={darkMode ? "dark-mode" : ""}>
      <div className="container">
        <form onSubmit={handleSubmit} className={`form-container ${darkMode ? "dark" : ""}`}>
          <h2>Event Registration</h2>
          <div className="form-group">
            <label htmlFor="name">Name:</label>
            <input
              type="text"
              id="name"
              value={name}
              onChange={handleNameChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email:</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={handleEmailChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="age">Age:</label>
            <input
              type="number"
              id="age"
              value={age}
              onChange={handleAgeChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Are you attending with a guest?</label>
            <div className="radio-group">
              <label>
                <input
                  type="radio"
                  name="guestAttendance"
                  value="yes"
                  checked={isAttendingWithGuest}
                  onChange={handleGuestAttendanceChange}
                />
                Yes
              </label>
              <label>
                <input
                  type="radio"
                  name="guestAttendance"
                  value="no"
                  checked={!isAttendingWithGuest}
                  onChange={handleGuestAttendanceChange}
                />
                No
              </label>
            </div>
          </div>
          {isAttendingWithGuest && (
            <div className="form-group">
              <label htmlFor="guestName">Guest Name:</label>
              <input
                type="text"
                id="guestName"
                value={guestName}
                onChange={handleGuestNameChange}
                required
              />
            </div>
          )}
          <div className="button-group">
            <button type="submit" className="button button-primary">
              Submit
            </button>
            <button type="button" onClick={toggleDarkMode} className="button button-secondary">
              Toggle Dark Mode
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
